function drawQrCode(coder) {

    var quietZoneSize = 4;
    var quietZone = quietZoneSize * blocksize;
    var size = coder.size * blocksize + 2 * quietZone;

    svg.setAttribute('width', size);
    svg.setAttribute('height', size);
    svg.setAttribute('viewBox', '0 0 ' + size + ' ' + size)

    var colors = {
        // QR Code colors:
        1: '#000000',
        0: '#FFFFFF',
        9: '#CCCCCC',

        // Test colors:
        101: 'red',
        100: 'yellow',

        // Mask colors:
        200: 'blue',
        201: 'black',
        300: 'green',
        301: 'pink',
        400: 'magenta',
        500: 'yellow',
        600: 'brown',
        700: 'orange',
        1000: 'cyan'
    };

    square(
        0,
        0,
        size,
        colors[0]
    );

    var dc = 0;
    var grid = coder.getData();
    var mask = coder.getMask();
//    grid = coder.getMask();

    for (var top = 0; top < grid.length; top++) {
        for (var left = 0; left < grid[0].length; left++) {
            if (mask[top][left] === coder.DATA) {
                ++dc;
            }
            square(
                quietZone + top * blocksize,
                quietZone + left * blocksize,
                blocksize,
                dataOnly && mask[top][left] !== coder.DATA ? colors[9] : colors[grid[top][left]]
            );
        }
    }

    var description = '' + coder.V + ', ' + coder.getEccLevel() + ', ' + coder.getMode();

    text(description, quietZone, size - quietZone / 4);
//    console.log({'DATA MODULES COUNT': dc});
}

init();
drawQrCode(coder);

